import React, {useState} from 'react';

const Counter = () => {
  const [number, setNumber] = useState(0);

  const onIncrase = () => {
    console.log(1);
  }
  const deCrease = () => {
    console.log(-1);
  }
  return (
    <div>
      <h1>0</h1>
      <button onClick={onIncrase}>+</button>
      <button onClick={deCrease}>-</button>
    </div>
  );
};

export default Counter;
